`to5.transform("function* f(xs) {return [for (x of xs) yield x] }", {experimental: true})` generates code involving:

    _toArray(xs).map(function (x) {
          return yield x;
    })

which is not valid ES5 since the `yield` is still there. The same is true of `await`. Using `[for (x of xs) for (y of ys) yield (x+y)]` no longer uses `map`, but still leaves the `yield` in there.

I don't know if `await`/`yield` in list comprehensions is allowed. If it isn't, it should give a compile error rather than generating invalid code.

Basically, the `no-shadow` rule is a great one and makes a lot of sense.

Anyway, there is one scenario where shadowing is (IMHO) perfectly fine, hence I'd love to have the possibility to add exceptions to the `no-shadow` rule.

This scenario is the `err` parameter name, as seen in callbacks:

    doSomething(function (err) {
      doSomethingElse(function (err) {
        // ...
      });
    });

Here, the `no-shadow` rule complains about the second `err` shadowing the first one, but IMHO this is perfectly fine and common in Node.js programming.

What do you think about this?

